import { initializeApp } from "firebase/app";

const firebaseConfig = {
  apiKey: process.env.VITE_APT_KEY,
  authDomain: process.env.VITE_APT_DOMAIN,
  databaseURL: process.env.VITE_APT_URL,
  projectId: "umka-77a72",
  storageBucket: process.env.VITE_APT_STORAGE,
  messagingSenderId: process.env.VITE_APT_MESSAGING,
  appId: process.env.VITE_APT_APPID,
};
